import React from "react";
import { Media, Player } from "react-media-player";
import { MuteUnmute, PlayPause } from "react-media-player/lib/controls";

function Popup(props) {
  return props.trigger ? (
    <div className="popup fixed z-10 w-full h-full">
      <div className="popup-innere">
        <Media>
          <Player src="https://youtu.be/JAfy0gAE0yU" />
          <PlayPause />
          <MuteUnmute />
        </Media>
        <button className="close-btn">Close</button>
        {props.children}
      </div>
    </div>
  ) : (
    ""
  );
}

export default Popup;
